import React from 'react'
import Sidebar from '../../components/sidebar/Sidebar'
import './settings.css'

const Settings = () => {
  return (
    <div className='settings'>
        <div className='settingsWrapper'>
            <Sidebar/>
        </div>
    </div>
  )
}

export default Settings
